    [CascadingParameter] public MudDialogInstance MudDialog { get; set; } = default!;
    [Parameter] public AccountModel accs { get; set; }
    private bool IsLoading = false, reload = false;
    private AccountModel account = new();
    private string confirmPassword = "";

    void Cancel()
    {
        MudDialog.Cancel();
    }

    private async Task Save()
    {
        if (String.IsNullOrEmpty(account.Password) || String.IsNullOrEmpty(confirmPassword))
        {
            Extensions.ShowAlert("All fields are required.", Variant.Filled, SnackBarService, Severity.Error);
            return;
        }
        IsLoading = true;
        StateHasChanged();
        if(account.Password == confirmPassword)
        {
            account.UserId = accs.UserId;
            account.Username = accs.Username;
            Task t =  AccountService.UpdatePassword(accs.UserId, account);
            await t;
            if(t.Status == TaskStatus.RanToCompletion)
